/**
 * 转换字符串 str 为驼峰写法。例如 `smallBoy`。
 * @Since 1.0.0
 * @Catalog String
 * @param [str = ''] (string): 要转换的字符串。
 * @returns (string): 返回驼峰写法的字符串。
 * @example
 * _.camelCase('Foo Bar');
 * // => 'fooBar'
 *
 * _.camelCase('--foo-bar--');
 * // => 'fooBar'
 *
 * _.camelCase('__FOO_BAR__');
 * // => 'fooBar'
 */
export default function camelCase(str?: any): string;
